var body = document.body;
var textContent = body.textContent || body.innerText;

if (textContent.indexOf('Доступ запрещён!!!') > 0 && textContent.indexOf('Основание - Федеральный закон № 139-ФЗ от 28 июля 2012 года') > 0)
    window.location.href = "https://www.google.ru/search?newwindow=1&q=cache:" + window.location.href;